    'graph_equal':{d:'यदि इनपुट ग्राफ G1 और G2 बराबर हैं तो true लौटाता है, अर्थात जब G1 और G2 के शीर्ष और किनारा समुच्चय तथा दोनों ग्राफों में शीर्षों का क्रम मेल खाते हैं। यदि ग्राफ भारित हैं (दोनों (अ)भारित और (अ)निर्देशित होने चाहिए), तो दोनों ग्राफों में एक ही किनारे को दिए गए भार बराबर होने चाहिए।',p:'Graph(G1),Graph(G2)'},
