    'hasard':{d:'(hasard n)=एक यादृच्छिक पूर्णांक (या (hasard p,n)=एक वास्तविक संख्या या hasard(p..n)=एक वास्तविक फलन) 0..n-1 में समान वितरण के साथ (या [p;n] में)(hasard= (hasard 0,1)=[0,1[ में एक यादृच्छिक वास्तविक संख्या) या hasard(n,b1,b2)=b1 और b2 के बीच n पूर्णांक या hasard(n,L)=L के n तत्व। यदि hasard का केवल एक आर्गुमेंट है, तो () आवश्यक नहीं हैं (कछुआ भाषा के साथ संगतता)।',p:'Intg(n) or Interval(p..n) or NULL,[Intg(b1) or Lst(L)],[Intg(b2)]'},
