    'hessenberg':{d:'आव्यूह को Hessenberg रूप में घटाना। [P,B] लौटाता है जैसे कि B=inv(P)*A*P, डिफ़ॉल्ट रूप से n=0 परिणाम सटीक है अन्यथा परिणाम संख्यात्मक है। n=-1 के लिए B त्रिकोणीय है, n=-2 के लिए P लंबकोणीय है और यदि n अभाज्य है तो परिणाम mod n है।',p:'Mtrx(A),[Intg(n)]'},
